document.addEventListener('DOMContentLoaded', function() {
            var draggableContainers = document.querySelectorAll('.draggable-container');

            draggableContainers.forEach(function(container) {
                container.addEventListener('dragstart', function(event) {
                    var style = window.getComputedStyle(event.target, null);
                    var str = (parseInt(style.getPropertyValue("left"), 10) - event.clientX) + ',' + 
                              (parseInt(style.getPropertyValue("top"), 10) - event.clientY);
                    event.dataTransfer.setData("text/plain", str);
                });

                document.body.addEventListener('dragover', function(event) {
                    event.preventDefault(); // Necessary to allow the drop
                });

                document.body.addEventListener('drop', function(event) {
                    var offset = event.dataTransfer.getData("text/plain").split(',');
                    var container = document.querySelector('.draggable-container[draggable="true"]'); // Find the dragged container
                    container.style.left = (event.clientX + parseInt(offset[0], 10)) + 'px';
                    container.style.top = (event.clientY + parseInt(offset[1], 10)) + 'px';
                    event.preventDefault();
                });
            });
        });